import { DataTable, Table } from '@primer/react/experimental';
import {
  Box,
  Button,
  Link,
  Heading,
  Text,
  TextInput,
  Flash,
} from '@primer/react';
import { accessTokens } from '../../../data/Data';
import { InfoIcon, XCircleFillIcon, XIcon } from '@primer/octicons-react';
import { Filters } from '../../Filters/Filters';

export function AccessTokens() {
  const smallRowWidth = '20%';
  return (
    <Box sx={{ width: '100%', mt: 5 }}>
      <Box
        sx={{
          pb: 2,
          mb: 3,
          borderBottom: '1px solid',
          borderColor: 'border.default',
          width: '100%',
        }}
      >
        <Heading
          sx={{
            fontSize: 3,
          }}
        >
          Access tokens
        </Heading>
        <Text
          sx={{
            color: 'fg.muted',
            fontSize: 1,
          }}
        >
          View usage by individual token
        </Text>
      </Box>
      <Box sx={{ mb: 3 }}>
        <Flash
          sx={{
            display: 'grid',
            gridTemplateColumns: 'min-content 1fr minmax(0, auto)',
            gridTemplateRows: 'min-content',
            gridTemplateAreas: `'visual message actions close'`,
            '@media screen and (max-width: 543.98px)': {
              gridTemplateColumns: 'min-content 1fr',
              gridTemplateRows: 'min-content min-content',
              gridTemplateAreas: `
        'visual message close'
        '.      actions actions'
      `,
            },
          }}
        >
          <Box
            sx={{
              display: 'grid',
              paddingBlock: 'var(--base-size-8)',
              alignSelf: 'start',
              gridArea: 'visual',
            }}
          >
            <InfoIcon />
          </Box>
          <Box
            sx={{
              fontSize: 1,
              lineHeight: '1.5',
              padding: '0.375rem var(--base-size-8)',
              alignSelf: 'center',
              gridArea: 'message',
            }}
          >
            This is a flash message with an icon and an action.
            <Link href='/'> Learn more.</Link>
          </Box>
          <Box
            sx={{
              gridArea: 'actions',
              '@media screen and (max-width: 543.98px)': {
                alignSelf: 'start',
                margin: 'var(--base-size-8) 0 0 var(--base-size-8)',
              },
            }}
          >
            <Button>Join waitlist</Button>
          </Box>
          <Box
            sx={{
              gridArea: 'close',
              marginLeft: 'var(--controlStack-medium-gap-condensed)',
            }}
          >
            <IconButton
              variant='invisible'
              icon={XIcon}
              aria-label='Dismiss'
              sx={{ svg: { margin: '0', color: 'fg.muted' } }}
            />
          </Box>
        </Flash>
      </Box>
      <Box
        sx={{
          display: 'flex',
          width: '100%',
        }}
      >
        <Filters />
        <Box
          sx={{
            position: 'relative',
            mb: 3,
            width: '100%',
          }}
        >
          <TextInput
            sx={{
              width: '100%',
              borderTopLeftRadius: 0,
              borderBottomLeftRadius: 0,
              pl: '270px',
            }}
            trailingAction={
              <TextInput.Action
                icon={XCircleFillIcon}
                aria-label='Clear input'
                sx={{ color: 'fg.subtle' }}
              />
            }
          />
          <Box
            sx={{
              position: 'absolute',
              left: 2,
              top: '50%',
              transform: 'translateY(-50%)',
              fontSize: 1,
              display: 'flex',
            }}
          >
            <Text>rate limited:</Text>
            <Text
              sx={{
                bg: 'accent.subtle',
                borderRadius: 1,
                px: 1,
                color: 'accent.emphasis',
              }}
            >
              true
            </Text>
          </Box>
          <Box
            sx={{
              position: 'absolute',
              left: '123px',
              top: '50%',
              transform: 'translateY(-50%)',
              fontSize: 1,
              display: 'flex',
            }}
          >
            <Text>sort:</Text>
            <Text
              sx={{
                bg: 'accent.subtle',
                borderRadius: 1,
                px: 1,
                color: 'accent.emphasis',
              }}
            >
              most rate limited
            </Text>
          </Box>
        </Box>
      </Box>
      <Table.Container
        sx={{
          width: '100%',
        }}
      >
        <DataTable
          data={accessTokens.sort(
            (a, b) => b.rateLimitedRequests - a.rateLimitedRequests
          )}
          columns={[
            {
              header: 'Token',
              field: 'name',
              rowHeader: true,
              renderCell: (row) => (
                <Box
                  sx={{
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <Link
                    href='/token-name'
                    sx={{
                      color: 'fg.default',
                      fontSize: 1,
                      ':hover': {
                        color: 'accent.emphasis',
                        textDecoration: 'none',
                      },
                    }}
                  >
                    <Text>{row.name}</Text>
                  </Link>
                  <Text
                    sx={{
                      color: 'fg.muted',
                      fontWeight: 400,
                    }}
                  >
                    {row.type}
                    {row.expires === 0 && (
                      <>
                        <Text
                          mx={2}
                          as='span'
                        >
                          ·
                        </Text>
                        <Text
                          sx={{ color: 'danger.emphasis' }}
                          as='span'
                        >
                          Expired
                        </Text>
                      </>
                    )}
                    {row.expires >= 1 && row.expires <= 14 ? (
                      <>
                        <Text
                          mx={2}
                          as='span'
                        >
                          ·
                        </Text>
                        <Text
                          sx={{ color: 'attention.emphasis' }}
                          as='span'
                        >
                          Expires in {row.expires} days
                        </Text>
                      </>
                    ) : null}
                  </Text>
                </Box>
              ),
            },
            {
              header: 'Total requests',
              field: 'type',
              width: smallRowWidth,
              renderCell: (row) => (
                <Text
                  sx={{
                    fontSize: 1,
                  }}
                >
                  {row.totalRequests}
                </Text>
              ),
            },
            {
              header: 'Rate limited requests',
              field: 'type',
              width: smallRowWidth,
              renderCell: (row) => (
                <Text
                  sx={{
                    fontSize: 1,
                  }}
                >
                  {row.rateLimitedRequests}
                </Text>
              ),
            },
            {
              header: 'Last rate limited',
              field: 'updatedAt',
              width: smallRowWidth,
              renderCell: (row) => (
                <Text
                  sx={{
                    fontSize: 1,
                  }}
                >
                  {row.lastUsed}
                </Text>
              ),
            },
          ]}
        />
        <Table.Pagination
          aria-label='Pagination for access tokens'
          pageSize={10}
          totalCount={40}
        />
      </Table.Container>
    </Box>
  );
}
